import { animated, useSpring } from 'react-spring';
import { easeQuadIn, easeQuadOut, easeQuadInOut, easeInOutSine } from 'd3-ease';

function Elevator ({ y, style, handleElevetorArrived }) {
  const spring = useSpring({
    to: { y },
    config: {
      duration: 2000,
      easing: (t) => {
        if (t < 0.3) {
          return easeQuadIn(t / 0.3);
        } else if (t < 0.7) {
          return easeQuadInOut((t - 0.3) / 0.4);
        } else {
          return easeQuadOut((t - 0.7) / 0.3);
        }
      },
    },
    onRest: () => {
      handleElevetorArrived();
    },
  });

  return (
    <animated.div
      className="elevator"
      style={{
        ...style,
        transform: spring.y.to((y) => `translateY(${y}px)`),
      }}
    >
      <img className="elevator-image" src="./elevatorSvg/icons8-elevator.svg" alt="Woops"></img>
    </animated.div>
  );
}

export default Elevator;
